#include "word.h"
#include <cstdlib>
#include <cstdio>
#include <cstring>
#include <cassert>
#include <cstdarg>
#include <iostream>
#include <random>
#include <string>

static const int NUM_SCRAMBLE = 8869;
static const char SCRAMBLE[8869 * 5 + 1] = "";
static char SCRAMBLE_BACKUP[8869 * 5 + 1];
static const int win_points[5] = { 85, 90, 100, 120, 150 };

static FILE* flog = nullptr;
static FILE* fscore = nullptr;

void setResult(double score, const char* message = 0, ...) {
  if (message && flog) {
    va_list args;
    va_start(args, message);
    vfprintf(flog, message, args);
    va_end(args);
  }
  fprintf(fscore, "%0.3f\n", score);
  exit(0);
}

void check(bool expr, double res = 0.0, const char* message = 0, ...) {
  if (!expr) {
    if (!message || !flog)
      setResult(res);
    else {
      va_list args;
      va_start(args, message);
      vfprintf(flog, message, args);
      va_end(args);
      fprintf(fscore, "%0.2f\n", res);
      exit(0);
    }
  }
}

int main() {
  // input from the screen
  fscore = stdout;  // output the score to the screen
  flog = stderr;  // do not output the log

  int T;
  bool gold[5], silver[5];
  const int win_points_backup[5] = { 85, 90, 100, 120, 150 };
  std::uniform_int_distribution<> dis(0, NUM_SCRAMBLE - 1);
  unsigned long long seed;
  memcpy(SCRAMBLE_BACKUP, SCRAMBLE, sizeof(SCRAMBLE));

  std::string scramble_input;
  std::cin >> T >> seed;
  scramble_input = SCRAMBLE;
  // std::cin >> scramble_input;
  check(T > 0, 0, "The number of test cases must be positive.");
  check(scramble_input == std::string(SCRAMBLE), 0, "Input scramble words does not match the preset one.");
  std::mt19937 gen(seed);

  init(NUM_SCRAMBLE, SCRAMBLE_BACKUP);  // avoid contestants modifying the array SCRAMBLE
  int total_score = 0;
  for (int i = 1; i <= T; i++) {
    if (dis(gen) % 5 == 0) {
      // make the pattern different from std::mt19937
      dis(gen);
    }
    int answer = dis(gen);
    char init_letter = SCRAMBLE[answer * 5];
    const char* guess_word = guess(i, 5, init_letter, gold, silver);
    for (int j = 4; j >= 0; j--) {
      if (strlen(guess_word) != 5) {
        // invalid guess
        break;
      }
      bool correct = true;
      for (int k = 0; k < 5; k++) {
        gold[k] = guess_word[k] == SCRAMBLE[answer * 5 + k];
        if (!gold[k])
          correct = false;
      }
      bool is_valid_guess = false;
      for (int l = 0; l < NUM_SCRAMBLE; l++) {
        bool same = true;
        for (int k = 0; k < 5; k++) {
          if (guess_word[k] != SCRAMBLE[l * 5 + k]) {
            same = false;
            break;
          }
        }
        if (same) {
          is_valid_guess = true;
          break;
        }
      }
      if (!is_valid_guess) {
        break;
      }
      if (correct) {
        total_score += win_points[j];
        break;
      }
      if (j == 0) {
        break;
      }
      for (int k = 0; k < 5; k++) {
        silver[k] = false;
        for (int l = 0; l < 5; l++)
          if (!gold[k] && !gold[l] && guess_word[k] == SCRAMBLE[answer * 5 + l])
            silver[k] = true;
      }
      guess_word = guess(i, j, init_letter, gold, silver);
    }
  }

  check(scramble_input == std::string(SCRAMBLE), 0, "Scramble words modified.");
  check(scramble_input == std::string(SCRAMBLE_BACKUP), 0, "Scramble words modified.");
  for (int i = 0; i < 5; i++) {
    check(win_points[i] == win_points_backup[i], 0, "Point parameters modified.");
  }

  if (flog) {
    fprintf(flog, "Total score: %d, ", total_score);
  }

  double final_score = total_score * 1.0 / T;
  if (final_score > 100)
    final_score = 100;

  setResult(final_score, "Final score: ", final_score);
  return 0;
}
